import axios from '../custom-axios/book-axios';

const BookService = {

    getBooks: () => {
        return axios.get("/book");
    },

    addBook: (bookName, price, category) => {
    return axios.post("/book", {
        "bookName" : bookName,
        "price": price,
        "sales" : 0,
        "category" : category
    });
    }

}

export default BookService;
